import React from "react";
import { BrowserRouter as Router, Route} from "react-router-dom";
import MainMenu from "./MainMenu";
import Item1 from "./items/Item1"
import Item2 from "./items/Item2"
import Item3 from "./items/Item3"
import Item4 from "./items/Item4"
import Item5 from "./items/Item5"
import Item6 from "./items/Item6"

export default class Main extends React.Component{
  render() {
    return(
      <main className="App_main">
        <Router>
          <MainMenu />
          <Route exact path='/item1' component={Item1} />
          <Route exact path='/item2' component={Item2} />
          <Route exact path='/item3' component={Item3} />
          <Route exact path='/item4' component={Item4} />
          <Route exact path='/item5' component={Item5} />
          <Route exact path='/item6' component={Item6} />
        </Router>
        <p>This is main Component</p>
      </main>
    )
  }
}
